import { BrowserRouter } from 'react-router-dom';
import "./App.css";
import HeaderBar from "./router/HeaderBar";
import FooterBar from './router/FooterBar';
import MovieRouter from './router/MovieRouter';

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <HeaderBar />
        <MovieRouter />
        <FooterBar />
      </div>
    </BrowserRouter>
  );
}
export default App;
